import React from 'react';
import Navbar from "./components/Navbar/Navbar";
import './App.css';
import { Route, Router, BrowserRouter} from 'react-router';
import Switch from "react-switch";
import Home from './Home'
import Food from './Food'








function App() {
  return (
       <div className='App'>

      <Router>

            <Navbar />
            <Switch>
              <Route exactly component={Food} pattern="/" />
              <Route exactly component={Food} pattern="/path1" />
              <Route exactly component={Food} pattern="/path2" />
              <Route exactly component={Food} pattern="/path3" />
              <Route component={Food} />
            </Switch>

        </Router>


        </div>

  );
}
export default App;
